var routes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    icon: "nc-icon nc-chart-bar-32",
    component: <Dashboard />,
    layout: "/admin",
    category: ["admin", "student"] // Both categories have access
  },
  {
    path: "/Icons",
    name: "Manage Student",
    icon: "nc-icon nc-single-02",
    component: <Icons />,
    layout: "/admin",
    category: ["admin"] // Only admin has access
  },
  {
    path: "/notifications",
    name: "Manage Faculties",
    icon: "nc-icon nc-hat-3",
    component: <Notifications />,
    layout: "/admin",
    category: ["admin"] // Only admin has access
  },
  {
    path: "/user-page",
    name: "Profile",
    icon: "nc-icon nc-bookmark-2",
    component: <UserPage />,
    layout: "/admin",
    category: ["admin"] // Only admin has access
  },
  {
    path: "/ManageCoursePage",
    name: "Manage Course",
    icon: "nc-icon nc-book-bookmark",
    component: <ManageCoursePage />,
    layout: "/admin",
    category: ["admin"] // Only admin has access
  },
  {
    path: "/BatchManager",
    name: "Batch Manage",
    icon: "nc-icon nc-watch-time",
    component: <BatchManager />,
    layout: "/admin",
    category: ["admin"] // Only admin has access
  },
  {
    path: "/tables",
    name: "Manage Schedule",
    icon: "nc-icon nc-calendar-60",
    component: <TableList />,
    layout: "/admin",
    category: ["admin"] // Only admin has access
  },
  {
    path: "/typography",
    name: "Manage Exam",
    icon: "nc-icon nc-ruler-pencil",
    component: <Typography />,
    layout: "/admin",
    category: ["admin"] // Only admin has access
  },
  {
    path: "/Courses",
    name: "My Courses",
    icon: "nc-icon nc-single-copy-04",
    component: <Courses />,
    layout: "/admin",
    category: ["student"] // Only student has access
  },
  {
    path: "/QandA",
    name: "Question and Answer",
    icon: "nc-icon nc-bullet-list-67",
    component: <QandA />,
    layout: "/admin",
    category: ["student"] // Only student has access
  },
  {
    path: "/upgrade",
    name: "Manage Certification",
    icon: "nc-icon nc-trophy",
    component: <UpgradeToPro />,
    layout: "/admin",
    category: ["student", "admin"] // Both categories have access
  },
  {
    path: "/Liveclass",
    name: "My Classes",
    icon: "nc-icon nc-time-alarm",
    component: <Liveclass />,
    layout: "/admin",
    category: ["student"] // Only student has access
  },
];

const filteredRoutes = (category) => {
  return routes.filter(route => route.category.includes(category));
};

export default filteredRoutes;
